import React from "react";
import Slider from "../pages/home/Slider";
import Deal from "../pages/home/Deal";
import Mixi from "../pages/home/Mixi";
import CSGO from "../pages/home/CSGO";
import Items from "../pages/home/Items";
import PUBG from "../pages/home/PUBG";
import { GET_ALL } from "../api/apiService";

import Subscribe from "../pages/home/Subscribe";
function Home(props){
   return(
    <div class= "container">
    <Slider/>
    <Deal/>
    <Items/>
    <Mixi/>
    <CSGO/>
    <PUBG/>

    <div class="text-center">
    <a href="/listing" class="btn btn-primary "> ALL Product  <i class="fa fa-chevron-right"></i> </a>
</div>
    <Subscribe/>

</div>
   );
}
export default Home
